  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"hello"}}>{`Hello`}</MDXTag>
<MDXTag name="p" components={components}>{`Moinsen`}</MDXTag>
           </MDXTag>
  }
}
